    'help.WhatAreClassifieds': '\u751A\u9EBC\u662F\u5206\u985E\u4FE1\u606F?',
    'help.WhatAreClassifieds_content': '\u5206\u985E\u5EE3\u544A\u5F0F\u7684\u5EE3\u544A\uFF0C\u8CB7\u5BB6\u6703\u806F\u7E6B\u8CE3\u5BB6\u9032\u884C\u8AC7\u5224\uFF0C\u5373\u4F7F\u4ED6/\u5979\u63D0\u51FA\u4E00\u500B\u50F9\u683C\u3002',
    'help.WhatAreThingsThatPotentiallyFraudulentBuyersDo': '\u8A50\u6B3A\u8CB7\u5BB6\u6703\u63A1\u53D6\u54EA\u4E9B\u624B\u6BB5?',
    'help.WhatAreThingsThatPotentiallyFraudulentBuyersDo_content': '<ul>  <li>\u8ACB\u60A8\u532F\u9322\u5230\u4ED6\u5011\u7684\u5E33\u6236. </li>  <li>\u8CB7\u5BB6\u63D0\u4F9B\u9AD8\u50F9(\u4F46\u662F\u4EFF\u5192)\u7684\u51FA\u7D0D\u652F\u7968\u4F86\u63DB\u53D6\u60A8\u7684\u7269\u54C1. \u8A72\u51FA\u7D0D\u652F\u7968\u7684\u50F9\u683C\u5E38\u5E38\u9060\u8D85\u904E\u65BC\u60A8\u7684\u7269\u54C1\u800C\u4E14\u8CB7\u5BB6\u8ACB\u60A8\u7D93\u7531\u532F\u6B3E\u670D\u52D9\u532F\u9918\u984D\u7D66\u4ED6. \u7576\u9280\u884C\u5728\u8655\u7406\u9019\u4E9B\u5047\u652F\u7968\u800C\u672A\u80FD\u6210\u529F\u514C\u73FE\u6642\u6703\u8981\u60A8\u8CA0\u8CAC. \u6B3A\u8A50\u6D89\u53CA\u5230\u7B2C\u4E09\u8005(\u904B\u8CA8\u4E2D\u4ECB\u4EE3\u7406, \u6B20\u8CB7\u5BB6\u9322\u7684\u5546\u696D\u5408\u5925). \u6211\u5011\u5F37\u70C8\u52F8\u60A8\u4E0D\u8981\u532F\u6B3E.</li>  <li>\u5EFA\u8B70\u4E00\u500B\u60A8\u4E0D\u719F\u6089\u7684\u4FE1\u8A17\u670D\u52D9\u6216\u652F\u4ED8\u670D\u52D9. </li>  <li>\u5C07\u5927\u984D\u7684\u8A02\u55AE\u9001\u53BB\u570B\u5916\u7684\u4F4D\u7F6E.</li>  <li>\u8AAA\u6703\u5728\u6536\u5230\u5546\u54C1\u524D\u5148\u4ED8\u6B20\u6B3E\u7684\u4E00\u534A,\u4E4B\u5F8C\u518D\u4ED8\u9918\u984D. </li>  <li>\u62D2\u7D55\u63D0\u4F9B\u80FD\u78BA\u8A8D\u7684\u96FB\u8A71\u865F\u78BC. </li>  <li>\u7528\u570B\u969B\u4FE1\u7528\u5361\u6216\u73FE\u91D1\u652F\u7968\u652F\u4ED8. </li></ul>',
    'help.WhatAreThingsThatPotentiallyFraudulentSellersDo': '\u8A50\u6B3A\u8CE3\u5BB6\u6703\u63A1\u53D6\u54EA\u4E9B\u624B\u6BB5?',
    'help.WhatAreThingsThatPotentiallyFraudulentSellersDo_content': '<ul><li>\u6703\u8ACB\u60A8\u532F\u9322\u5230\u4E00\u500B\u570B\u969B\u5E33\u6236. \u8CE3\u5BB6\u6703\u8ACB\u60A8\u5BC4\u9322\u5230\u570B\u5916\u7136\u5F8C\u53EA\u63A5\u53D7\u897F\u806F\u532F\u6B3E(Western Union)\u6216\u5176\u4ED6\u91D1\u9322\u8F49\u79FB\u670D\u52D9(e-Gold). </li>  <li>\u5217\u4E00\u500B\u8207\u5546\u54C1\u63CF\u8FF0\u4E0D\u4E00\u6A23\u7684\u5730\u5740.</li>  <li>\u63A8\u85A6\u4E00\u500B\u4E0D\u719F\u6089\u7684\u8CA1\u7522\u4FE1\u8A17\u6216\u4ED8\u6B3E\u670D\u52D9.</li>  <li>\u5C0D\u51FA\u552E\u5546\u54C1\u7684\u771F\u5BE6\u6027\u4E0D\u5766\u8AA0.</li>  <li>\u4E0D\u63D0\u4F9B\u4E00\u500B\u80FD\u78BA\u8A8D\u7684\u96FB\u8A71\u865F\u78BC. </li>  <li>\u8A66\u8457\u8AAA\u670D\u60A8\u4E0D\u8981\u7528\u6709\u4FDD\u969C\u7684\u4ED8\u6B3E\u670D\u52D9 (\u80FD\u63A5\u53D7\u7684\u670D\u52D9\u5C31\u5982Escrow.com\u548C\u8C9D\u5BF6PayPal). </li>  <li>\u6301\u7E8C\u5730\u4E0D\u63A5\u96FB\u8A71\u6216\u56DE\u96FB\u5B50\u90F5\u4EF6. </li>  <li>\u6301\u7E8C\u5730\u63D0\u4F9B\u7406\u7531\u89E3\u91CB\u60A8\u70BA\u4EC0\u9EBC\u60A8\u5C1A\u672A\u6536\u5230\u5546\u54C1. </li>  <li>\u8CE3\u53EF\u7591\u7684\u8EDF\u4EF6,\u97F3\u789F,\u5F71\u789F\u526F\u672C. </li>  <li>\u62D2\u7D55\u63D0\u4F9B\u4E00\u500B\u80FD\u7528\u7684\u8CA8\u4EF6\u8FFD\u8E64\u5DEE\u67E5\u8A62\u865F\u78BC. </li>  <li>\u4EE5\u53EF\u7591\u7684\u4FBF\u5B9C\u50F9\u8CE3\u4E00\u500B\u5373\u8CB4\u53C8\u71B1\u9580\u7684\u5546\u54C1. </li></ul>',
