    'featured_listings.AdditionalTermsForFeaturedAds_content': '\u672C\u7AD9\u7684<<LINK_TERMS_USE>>\u4F7F\u7528\u689D\u6B3E<</LINK_TERMS_USE>>\u548C\u9644\u52A0\u689D\u6B3E\u8986\u84CB\u7CBE\u9078\u5EE3\u544A\u7684\u4F7F\u7528:<br /><ul><li>OLX\u6703\u5728\u4ED8\u6B3E\u7A0B\u5E8F\u7D50\u5C3E\u767C\u4E00\u5C01\u201C\u8A02\u55AE\u78BA\u4EFB\u201D\u96FB\u5B50\u90F5\u4EF6\u4F5C\u70BA\u7CBE\u9078\u5EE3\u544A\u4ED8\u6B3E\u8B49\u660E.</li><li>\u5982\u679C\u56E0\u70BA\u67D0\u7A2E\u539F\u56E0, \u6280\u8853\u6216\u4EFB\u4F55\u6027\u8CEA, \u60A8\u7684\u5EE3\u544A\u4E0D\u5728\u201C\u7CBE\u9078\u5EE3\u544A\u201D\u5340\u986F\u793A, OLX\u552F\u4E00\u8CAC\u4EFB\u662F\u5728\u53EF\u80FD\u6642\u9593\u5167\u5728\u201C\u7CBE\u9078\u5EE3\u544A\u201D\u5340\u767C\u4F48\u60A8\u7684\u5EE3\u544A.</li><li>\u7B2C\u4E09\u8005\u670D\u52D9\u516C\u53F8\u63D0\u4F9B\u6211\u5011\u4ED8\u6B3E\u65B9\u5F0F.</li><li>OLX\u81EA\u884C\u6C7A\u5B9A\u5EE3\u544A\u662F\u5426\u5177\u6709\u653B\u64CA\u6027, \u8272\u60C5, \u5783\u573E\u90F5\u4EF6(\u5305\u62EC\u91CD\u8907\u767C\u4F48), \u6F5B\u5728\u6B3A\u8A50\u53EF\u80FD\u6216\u53EF\u80FD\u4FB5\u72AF\u4EFB\u4F55\u7248\u6B0A, \u6B64\u985E\u5EE3\u544A\u4E0D\u5C07\u6210\u70BA\u7CBE\u9078\u800C\u4E14\u4E0D\u88DC\u511F/\u9000\u6B3E.</li><li>\u7CBE\u9078\u5EE3\u544A\u670D\u52D9\u662F\u5728\u201C\u4E0D\u4F5C\u66F4\u6539\u201D\u6216\u201C\u53EF\u63D0\u4F9B\u201D\u7684\u57FA\u790E\u4E0A, \u5728\u6CD5\u5F8B\u5141\u8A31\u7684\u7BC4\u570D\u5167\u4E0D\u63D0\u4F9B\u4EFB\u4F55\u4FDD\u8B49.  OLX\u4E0D\u505A\u4EFB\u4F55\u64D4\u4FDD\u6216\u9673\u8FF0\u800C\u4E14\u4E0D\u70BA\u7CBE\u9078\u5EE3\u544A\u670D\u52D9\u5167\u5BB9\u7684\u7CBE\u78BA\u5EA6\u6216\u5B8C\u6574\u6027\u4F5C\u8CA0\u8CAC.</li></ul>',
